/**     Constellation description structure. This is private structure and should be not used in user code. */
struct ConstellationDesc
{
  /**   Name. */
  const char * const name;

  /**   Number of stars from full bright star catalog. */
  const unsigned short numberOfStars;

  /**   Array of star indices from full bright star catalog. */
  const unsigned short * const stars;

  ConstellationDesc(const char *name_, unsigned short numberOfStars_, const unsigned short *stars_)
  : name(name_), numberOfStars(numberOfStars_), stars(stars_)
  {}

private:
  ConstellationDesc & operator=(const ConstellationDesc &rhs);
};

